// Bumberman code:

volatile int pixel_buffer_start; // global variable

void plot_pixel(int x, int y, short int line_color) {
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void clear_screen() {
    for (int i = 0; i < RESOLUTION_X; i++) {
        for (int j = 0; j < RESOLUTION_Y; j++) {
            plot_pixel(i, j, 0);
        }
    }
}

void wait_for_vsync() {
    volatile int * pixel_ctrl_ptr = (int *) 0xFF203020;
    register int status;

    *pixel_ctrl_ptr = 1;

    status = *(pixel_ctrl_ptr + 3);
    while ((status & 0x01) != 0) {
        status = *(pixel_ctrl_ptr + 3);
    }
}

void drawBlock(int x, int y, int blockType) {
    // functions draws blocks e.g Grass.. etc. Depending on blocktype. 
    int color = 0;
    for (int i = 0; i < BLOCK_WIDTH; i++) {
        for (int j = 0; j < BLOCK_WIDTH; j++) {
            if (blockType == GRASS) {
                color = grassSprite[i][j];
            } else if (blockType == STONE) {
                color = stoneSprite[i][j];
            } else if (blockType == BRICK) {
                color = brickSprite[i][j];
            } else if (blockType == EXPLODE) {
                color = explosionSprite[j][i];
            } else if (blockType == PLAYER1BOMB_THREE) {
                color = bombSpriteThree[j][i];
            } else if (blockType == PLAYER2BOMB_THREE) {
                color = bombSpriteThree[j][i];
            } else if (blockType == PLAYER1BOMB_TWO) {
                color = bombSpriteTwo[j][i];
            } else if (blockType == PLAYER2BOMB_TWO) {
                color = bombSpriteTwo[j][i];
            } else if (blockType == PLAYER1BOMB_ONE) {
                color = bombSpriteOne[j][i];
            } else if (blockType == PLAYER2BOMB_ONE) {
                color = bombSpriteOne[j][i];
            } else if (blockType == POWERUP_MOREBOMB) {
                color = powerUpMoreBombSprite[j][i];
            } else if (blockType == POWERUP_RADIUS) {
                color = powerUpRadiusSprite[j][i];
            } else if (blockType == POWERUP_MOVESPEED) {
                color = powerUpMoveSpeedSprite[j][i];
            }
            plot_pixel(x + i, y + j, color);
            fullMapArray[x + i][y +j] = blockType; 
        }
    }

}

