void keyboard_input() {
    volatile int *PS2 = (int *) PS2_BASE;
    
    int i = 0;
    // reads multiple inputs, maxInterrupt
    while (*PS2 & 0x8000) {
        keyInterrupts[i] = (*PS2 & 0xFF);
        i++;
    }
    // to clear out the rest 
    for (int j = i; j < maxInterrupt; j++) {
        keyInterrupts[j] = 0x0;
    }

    return;
}

void placeBomb(Player *player) {
    if (player->bombNum > player->bombsPlaced) {
        // check if player has enough bombs
        // check if we are on grass
        if (mapArray[player->BlockX][player->BlockY] == GRASS) {
            player->bombsPlaced++; 
            if (player->colour == RED) {
                mapArray[player->BlockX][player->BlockY] = PLAYER1BOMB_ONE; 
            } else 
                mapArray[player->BlockX][player->BlockY] = PLAYER2BOMB_ONE; 

            player->bombArrX[player->bombsPlaced - 1] = player->BlockX;
            player->bombArrY[player->bombsPlaced - 1] = player->BlockY; 
            player->bombTimer[player->bombsPlaced - 1] = BOMB_TIMER; 
            // make all other elements in the array NO_BOMB
            // for (int i = player->bombsPlaced; i < MAX_BOMBS; i++) {
            //     player->bombArrX[i] = NO_BOMB;
            //     player->bombArrY[i] = NO_BOMB;
            //     player->bombTimer[i] = NO_BOMB;
            // }
        }
    }
}

void checkBombs(Player *player) {
    // checks the timer on the bombs. if 0 EXPLODE! if NO_BOMB continue!
    // otherwise COUNT DOWN!!!!
    for (int i = 0; i < player->bombsPlaced; i++) {
        if (player->bombTimer[i] == 0)  {
            // EXPLOSION TIME
            // theoretically only the first, when i = 0, will this ever happen
            explosion(player->bombArrX[i], player->bombArrY[i], player->bombRadius);


            // basically popping the front of the array
            for (int i = 0; i < MAX_BOMBS - 1; i++) {
                player->bombArrX[i] = player->bombArrX[i + 1]; // shift each element to the left
                player->bombArrY[i] = player->bombArrY[i + 1]; // shift each element to the left
            }
            player->bombArrX[MAX_BOMBS - 1] = NO_BOMB; // set last element to zero or null
            player->bombArrY[MAX_BOMBS - 1] = NO_BOMB; // set last element to zero or null

            // decrement bombsplaced
            player->bombsPlaced--; 
            

        } else if (player->bombTimer[i] == BOMB_TIMER - (BOMB_TIMER / BOMB_INTERVALS)) {
            if (player->colour == RED) {
                mapArray[player->bombArrX[i]][player->bombArrY[i]] = PLAYER1BOMB_TWO; 
            } else 
                mapArray[player->bombArrX[i]][player->bombArrY[i]] = PLAYER2BOMB_TWO; 
            player->bombTimer[i]--;        
        }
        else if (player->bombTimer[i] == BOMB_TIMER - 2 * (BOMB_TIMER / BOMB_INTERVALS)) {
            if (player->colour == RED) {
                mapArray[player->bombArrX[i]][player->bombArrY[i]] = PLAYER1BOMB_THREE; 
            } else 
                mapArray[player->bombArrX[i]][player->bombArrY[i]] = PLAYER2BOMB_THREE; 
            player->bombTimer[i]--;        
        } else {
            player->bombTimer[i]--;
        }
    }
}

void explosion(int startingX, int startingY, int radius) {
    // starting x block and starting y block
    int numBlocks = 1;
    mapArray[startingX][startingY] = EXPLODE; 
    numExplosions++;
    Explosion explosionInsert; 
    explosionInsert.X_BLOCKS[numBlocks - 1] = startingX;
    explosionInsert.Y_BLOCKS[numBlocks - 1] = startingY; 
    // down
    for (int i = 1; i <= radius; i++) {
        int newY = startingY + i; 
        if (mapArray[startingX][newY] == GRASS || mapArray[startingX][newY] == BRICK) {
            numBlocks++; 
            explosionInsert.X_BLOCKS[numBlocks - 1] = startingX;
            explosionInsert.Y_BLOCKS[numBlocks - 1] = newY;
            mapArray[startingX][newY] = EXPLODE; 
            if (mapArray[startingX][newY] == BRICK){
                // we broke the brick now we just stop. 
                break; 
            }
        } else
            break;
    }
    // left
    for (int i = 1; i <= radius; i++) {
        int newX = startingX - i; 
            if (mapArray[newX][startingY] == GRASS || mapArray[newX][startingY] == BRICK) {
            numBlocks++; 
            explosionInsert.X_BLOCKS[numBlocks - 1] = newX;
            explosionInsert.Y_BLOCKS[numBlocks - 1] = startingY;
            mapArray[newX][startingY] = EXPLODE; 
            if (mapArray[newX][startingY] == BRICK){
                // we broke the brick now we just stop. 
                break; 
            }
        } else
            break;
    }
    // up
    for (int i = 1; i <= radius; i++) {
        int newY = startingY - i; 
        if (mapArray[startingX][newY] == GRASS || mapArray[startingX][newY] == BRICK) {
            numBlocks++; 
            explosionInsert.X_BLOCKS[numBlocks - 1] = startingX;
            explosionInsert.Y_BLOCKS[numBlocks - 1] = newY;
            mapArray[startingX][newY] = EXPLODE; 
            if (mapArray[startingX][newY] == BRICK){
                // we broke the brick now we just stop. 
                break; 
            }
        } else
            break;
    }
    // right
    for (int i = 1; i <= radius; i++) {
        int newX = startingX + i; 
            if (mapArray[newX][startingY] == GRASS || mapArray[newX][startingY] == BRICK) {
            numBlocks++; 
            explosionInsert.X_BLOCKS[numBlocks - 1] = newX;
            explosionInsert.Y_BLOCKS[numBlocks - 1] = startingY;
            mapArray[newX][startingY] = EXPLODE; 
            if (mapArray[newX][startingY] == BRICK){
                // we broke the brick now we just stop. 
                break; 
            }
        } else
            break;
    }
    explosionInsert.size = numBlocks; 
    explosionInsert.timer = EXPLOSION_TIMER; 
    explosions[numExplosions - 1] = explosionInsert;
}
void checkExplosions()  {
    for (int i = 0; i < numExplosions; i++)  {
        if (explosions[i].timer == 0)  {
            // pop the front and delete the explosions
            numExplosions--; 
            for (int j = 0; j < explosions[i].size; j++)  { // delete explosions 
                mapArray[explosions[i].X_BLOCKS[j]][explosions[i].Y_BLOCKS[j]] = GRASS;
            }
            
            
            for (int k = 0; k < MAX_EXPLOSIONS - 1; k++) {
                // pop front
                explosions[k] = explosions[k+1];
            }
            // make last element null basically
            Explosion explosionNew; 
            initializeExplosionStruct (&explosionNew);
            explosions[MAX_EXPLOSIONS - 1] = explosionNew;  

        } else {
            explosions[i].timer--;
        }
    }
}

void checkPlayerLoc(Player *player) {
    // checks if a player is on a power -up / explosion... etc.
    // check dead first. We use return statements to avoid double power up
    for (int i = 0; i < PLAYER_WIDTH; i += PLAYER_WIDTH - 1) {
        for (int j = 0; j < PLAYER_WIDTH; j += PLAYER_WIDTH - 1) {
            if (fullMapArray[player->x + i][player->y + j] == EXPLODE) {
                player->dead = TRUE; 
                return;
            }
        }
    }
    for (int i = 0; i < PLAYER_WIDTH; i += PLAYER_WIDTH - 1) {
        for (int j = 0; j < PLAYER_WIDTH; j += PLAYER_WIDTH - 1) {
            if (fullMapArray[player->x + i][player->y + j] == EXPLODE) {
                player->dead = TRUE; 
            } else if (fullMapArray[player->x + i][player->y + j] == POWERUP_MOREBOMB) {
                if (player->bombNum < MAX_BOMBS) {
                    player->bombNum++; 
                }
                numPowerUpsOnScreen--;
                // reset back to grass
                mapArray[calculateBlockX(player->x+i)][calculateBlockY(player->y+j)] = GRASS;
                return; 
            } else if (fullMapArray[player->x + i][player->y + j] == POWERUP_RADIUS) {
                player->bombRadius++;
                // reset back to grass
                numPowerUpsOnScreen--;
                mapArray[calculateBlockX(player->x+i)][calculateBlockY(player->y+j)] = GRASS;
                return;
            } else if (fullMapArray[player->x + i][player->y + j] == POWERUP_MOVESPEED) {
                if (player->moveSpeed < MAX_MOVESPEED) {
                    player->moveSpeed++; 
                }
                numPowerUpsOnScreen--;
                // reset back to grass
                mapArray[calculateBlockX(player->x+i)][calculateBlockY(player->y+j)] = GRASS;
                return;
            } 
        }
    }
}
